export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the Join Event button to be visible and click it
    await page.waitForSelector('button.btn.btn-secondary.btn-large');
    await page.click('button.btn.btn-secondary.btn-large');

    // Take a screenshot of the modal
    await page.waitForSelector('#eventCode'); // Ensure the input field is present
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_join_event_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_join_event_modal.png'));

    // Entering an event code (systematic guessing)
    const eventCodes = ['ABC123', 'DEF456', 'GHI789', 'JKL012']; // Example codes to iterate
    for (const code of eventCodes) {
      await page.fill('#eventCode', code);
      await page.click('button.btn.btn-primary'); // Click the Join Event button
      await page.waitForTimeout(1000); // Wait for potential feedback

      // Take a screenshot after attempting to join
      await page.screenshot({ path: path.join(screenshotsDir, `step_3_attempt_join_${code}.png`) });
      screenshots.push(path.join(screenshotsDir, `step_3_attempt_join_${code}.png`));

      // You could add logic to check for success/failure messages here if needed
    }

    return {
      success: true,
      action: "Attempted to join events with multiple codes",
      extractedData: { attemptedCodes: eventCodes },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
